import React, { useState } from 'react';
import { Routes, Route } from 'react-router-dom';
import RestaurantDetails from './RestaurantDetails'; // Asegúrate de que la ruta sea correcta
import './App.css'; // Importa tu CSS

function App() {
  const [query, setQuery] = useState('');
  const [filteredResults, setFilteredResults] = useState([]);
  const [notFound, setNotFound] = useState(false);
  const [filters, setFilters] = useState({ price: '', mealType: '', stars: '' });

  const handleSearch = () => {
    // Lógica para buscar restaurantes (conectarse a Elasticsearch o a tu backend)
    // Asegúrate de que 'filteredResults' se llene con los resultados de búsqueda
  };

  const applyFilters = () => {
    // Lógica para aplicar filtros sobre 'filteredResults'
  };

  const handleResultClick = (restaurant) => {
    // Lógica para redirigir a la página de detalles del restaurante
  };

  const renderStarsAndSoles = (soles, stars) => {
    return (
      <div className="starsAndSoles">
        {stars && Array.from({ length: stars }, (_, i) => (
          <img key={`star-${i}`} src="path_to_star_icon.png" alt="Star" className="icon-star" />
        ))}
        {soles && Array.from({ length: soles }, (_, i) => (
          <img key={`sun-${i}`} src="path_to_sun_icon.png" alt="Sun" className="icon-sun" />
        ))}
      </div>
    );
  };

  return (
    <div className="App">
      <img src="logo.png" alt="Logo" className="App-logo" />
      <div className="form">
        <input
          type="text"
          className="input"
          placeholder="Buscar restaurante..."
          value={query}
          onChange={(e) => setQuery(e.target.value)}
        />
        <button className="button" onClick={handleSearch}>Buscar</button>
      </div>

      <div className="filters">
        <div className="filterGroup">
          <div className="filter">
            <label>Precio</label>
            <select onChange={(e) => setFilters({ ...filters, price: e.target.value })}>
              <option value="">Seleccione precio</option>
              <option value="€">€</option>
              <option value="€€">€€</option>
              <option value="€€€">€€€</option>
            </select>
          </div>
          <div className="filter">
            <label>Tipo de Comida</label>
            <select onChange={(e) => setFilters({ ...filters, mealType: e.target.value })}>
              <option value="">Seleccione tipo de comida</option>
              <option value="italiana">Italiana</option>
              <option value="mexicana">Mexicana</option>
            </select>
          </div>
          <div className="filter">
            <label>Número de Estrellas</label>
            <select onChange={(e) => setFilters({ ...filters, stars: e.target.value })}>
              <option value="">Número de estrellas</option>
              {[1, 2, 3, 4, 5].map((num) => (
                <option key={num} value={num}>{num}</option>
              ))}
            </select>
          </div>
          <button className="button" onClick={applyFilters}>Aplicar Filtros</button>
        </div>
      </div>

      <div className="resultsGrid">
        {notFound ? (
          <p className="notFoundMessage">No se encontraron restaurantes.</p>
        ) : (
          filteredResults.map((restaurant) => (
            <div className="resultCard" key={restaurant._id} onClick={() => handleResultClick(restaurant)}>
              <img src={restaurant._source.photo_url} alt={restaurant._source.name} className="restaurantPhoto" />
              <div className="resultInfo">
                <h2 className="resultName">{restaurant._source.name}</h2>
                <div className="starsAndSoles">
                  {renderStarsAndSoles(restaurant._source.soles_number, restaurant._source.star_number)}
                </div>
                <p className="resultPrice">Precio: {restaurant._source.price}</p>
                <p className="resultMealType">{restaurant._source.meal_type}</p>
              </div>
            </div>
          ))
        )}
      </div>

      <Routes>
        <Route path="/:restaurantName" element={<RestaurantDetails />} />
      </Routes>
    </div>
  );
}

export default App;
